import './App.css';
import { useState } from 'react';
import data from './data';

function App() {

  const allNames = (data) => data.map((person) => person.name);
  const bornBefore1990 = (data) => data.map((person) => person.birthday.split('-')[2] < 1990);

  return (
    <div className='./App.css'>
      {allNames(data)}
    </div>

  );
}

export default App;
